import Button from '../../UI/Button/Button';

function HeaderContacts() {
  return (
    <div>
      <p className={styles.hidden-mobile}>Company Name</p>
      <a className={styles.phone} href="tel:555-555-5555">555-555-5555</a>
      <p className={styles.hidden-mobile}>Mon - Fri: 9 - 5, Sat 9 - 2</p>
      <Button className='hidden-mobile' type='button'>Заказать Звонок</Button>
    </div>
  )
}

export default HeaderContacts
